import React from "react"
import style from "./style.module.scss"

import Image from "../../atoms/Image"

const Footer = () => {
    const goToPage = (socialMedia) => {
        switch (socialMedia) {
            case "facebook": 
            window.location.replace("http://www.w3schools.com");
        }
    }

    return (
        <div className={style.footer} >
            <div className={style.facebook} onClick={goToPage("facebook")} >
                <Image src="facebook-logo.svg" alt="facebook" width="20px" />
                <p></p>
            </div>
        </div>
    )
}

export default Footer
